<!doctype html>
<html>
    <head>
        <meta charset="utf-8">
        <meta http-equiv="x-ua-compatible" content="ie=edge">
        <title>Console</title>
        <meta name="description" content="">
        <meta name="viewport" content="width=device-width, initial-scale=1">
        <link rel="stylesheet" href="../assets/css/console.css">

    </head>
    <body>
      <div data-bind="console" class="console"></div>
      <script src="../assets/run-env.js"></script>
      <script>/**
 * Immutable property via Object.defineProperty
 */
"use strict";
var bar = {};

Object.defineProperty( bar, "length", {
  /**
   * Data descriptor
   * @type {*}
   */
  value: 0,
  /**
   * Data descriptor
   * @type {Boolean}
   */
  writable: false
});

bar.length = 10; // TypeError: "length" is read-only</script>
    </body>
</html>
